package main

import (
	"db"
	"fmt"
	"utils"
)

func main() {
	// init mysql
	mysqlDb, err := db.InitMysql()
	if err != nil {
		fmt.Printf("%s", err)
		return
	}
	defer func() {
		err = mysqlDb.Close()
		if err != nil {
			fmt.Printf("%s", err)
			return
		}
	}()

	// init redis
	redisPool := db.InitRedis()
	defer func() {
		err := redisPool.Close()
		if err != nil {
			fmt.Printf("%s", err)
			return
		}

	}()
	//server.Start()
	//server.DatabaseTest()

	mmm := `data:image/jpeg;base64,`
	err = utils.SaveImageFromBase64(mmm, "E:\\project\\SugarBackEnd\\data\\images\\x.jpg")
	if err != nil {
		fmt.Println(err)
	}
}
